import "./bank.css"
import {
    Link
  } from "react-router-dom";

const Bank = () => {
    return(
        <div className="header text-center">
            <h1>GRAND TURBO BANK!</h1>
            <p>Welcome to Grand Turbo Bank! Keep all your coins in one of our state of the art high-security vaults! We will keep them safe, its a <b>Grand Turbo guarantee!</b></p>
            <Link to="/">
                <button>
                    Go back!
                </button>
            </Link>
        </div>
    )
}

export default Bank;
